import React, { useState, useEffect } from "react";
import "../css/pages.css"; // Import the CSS file
import AOS from "aos"; // Import the AOS library
import "aos/dist/aos.css"; // Import the AOS CSS file

const Pages = () => {
  useEffect(() => {
    AOS.init(); // Initialize AOS on component mount
  }, []);
  const [activeAccordion, setActiveAccordion] = useState(null);

  const handleAccordionClick = (index) => {
    setActiveAccordion((prevIndex) => (prevIndex === index ? null : index));
  };

  const isAccordionActive = (index) => activeAccordion === index;
  const sectionStyle = {
    backgroundImage: 'url("../../public/img/bg2.jpg")',
    backgroundPosition: "right bottom",
    backgroundSize: "50%",
    backgroundRepeat: "no-repeat",
  };

  const yearExpStyle = {
    opacity: 0,
    transform: "translateY(100%) translateZ(0px)",
  };

  const textBlockStyle = {
    opacity: 1, // Change opacity from 0 to 1
    transform: "none", // Change transform value to "none"
  };

  const accordionItemStyle = {
    opacity: 1, // Change opacity from 0 to 1
    transform: "none", // Change transform value to "none"
  };
  const sectionStye = {
    backgroundImage: `url('/img/bg2.png')`,
    backgroundPosition: "right bottom",
    backgroundSize: "100%",
    backgroundRepeat: "no-repeat",
  };
  const h2Style = {
    opacity: 0,
    transform: "translateY(100%) translateZ(0px)",
  };
  return (
    <div className="container">
      <section
        class="section-full content-inner about-bx2"
        style={sectionStye}
        // style="
        //   background-image: url('/img/bg2.png');
        //   background-position: right bottom;
        //   background-size: 100%;
        //   background-repeat: no-repeat;
        // "
      >
        <div class="container">
          <div class="row">
            <div class="col-lg-6">
              <div class="dz-media">
                <div class="img1 aos-item">
                  <img src="/img/building.jpg" alt="" />
                </div>
                <div class="img2 aos-item" data-aos="fade-up">
                  <img src="/img/sofa.jpg" alt="" />
                </div>
                <div class="img3 aos-item">
                  <img src="/img/bsofa.jpg" alt="" />
                </div>
              </div>
            </div>
            <div class="col-lg-6 align-self-center">
              <div class="year-exp">
                <h2
                  class="year aos-item counter"
                  data-aos="fade-up"
                  // style="
                  //   opacity: 0;
                  //   transform: translateY(100%) translateZ(0px);
                  // "
                >
                  <span>25</span>
                </h2>
                <h4
                  class="text aos-item"
                  data-aos="fade-up"
                  data-aos-duration="1000"
                  data-aos-delay="600"
                  // style="
                  //   opacity: 0;
                  //   transform: translateY(100%) translateZ(0px);
                  // "
                >
                  Years Of Working Experience
                </h4>
              </div>
              <p
                class="m-b30 aos-item"
                data-aos="fade-up"
                data-aos-duration="800"
                data-aos-delay="400"
                // style="
                //   opacity: 0;
                //   transform: translateY(100%) translateZ(0px);
                // "
              >
                Donec lacus velit, volutpat a consequat quis, placerat vitae
                massa. Nulla facilisi. Fusce ac odio justo. Phasellus a risus in
                libero feugiat aliquam quis nec metus. Sed vulputate bibendum
                nulla, eu sodales magna gravida nec. Integer sit amet
                sollicitudin massa, a blandit lectus. Vivamus lacinia justo non
                congue blandit.
              </p>
              <div className="accordion dz-accordion about-faq" id="aboutFaq">
          <div className="accordion">
            <div
              className={`accordion-item ${
                isAccordionActive(1) ? "active" : ""
              }`}
              data-aos="fade-up"
            >
              <h2
                id="flush-headingOne"
                className="accordion-header accordion-header"
                onClick={() => handleAccordionClick(1)}
              >
                <button
                  type="button"
                  aria-expanded={isAccordionActive(1)}
                  className="accordion-button"
                >
                  <a className="fas fa-tools"></a>Construction
                  <span className="toggle-close"></span>
                </button>
              </h2>
              <div
                className={`accordion-collapse ${
                  isAccordionActive(1) ? "show" : ""
                }`}
              >
                <div className="accordion-body">
                  Vivamus sed eleifend diam. Proin vel orci commodo nulla
                  viverra feugiat nec quis neque.
                </div>
              </div>
            </div>
            <div
              className={`accordion-item ${
                isAccordionActive(2) ? "active" : ""
              }`}
              data-aos="fade-up"
            >
              <h2
                id="flush-headingTwo"
                className="accordion-header accordion-header"
                onClick={() => handleAccordionClick(2)}
              >
                <button
                  type="button"
                  aria-expanded={isAccordionActive(2)}
                  className="accordion-button collapsed"
                >
                  <i className="fas fa-home"></i>Architecture
                  <span className="toggle-close"></span>
                </button>
              </h2>
              <div
                className={`accordion-collapse ${
                  isAccordionActive(2) ? "show" : ""
                }`}
              >
                <div className="accordion-body">
                  Vivamus sed eleifend diam. Proin vel orci commodo nulla
                  viverra feugiat nec quis neque.
                </div>
              </div>
            </div>
            <div
              className={`accordion-item ${
                isAccordionActive(3) ? "active" : ""
              }`}
              data-aos="fade-up"
            >
              <h2
                id="flush-headingThree"
                className="accordion-header accordion-header"
                onClick={() => handleAccordionClick(3)}
              >
                <button
                  type="button"
                  aria-expanded={isAccordionActive(3)}
                  className="accordion-button collapsed"
                >
                  <i className="fas fa-pencil-alt"></i>Interior
                  <span className="toggle-close"></span>
                </button>
              </h2>
              <div
                className={`accordion-collapse ${
                  isAccordionActive(3) ? "show" : ""
                }`}
              >
                <div className="accordion-body">
                  Vivamus sed eleifend diam. Proin vel orci commodo nulla
                  viverra feugiat nec quis neque.
                </div>
              </div>
            </div>
          </div>
          </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Pages;
